import React from "react";
import MovieDetails from "./components/MovieDetails.jsx";
import "./style/movie.css";
function App() {
  const favoriteMovie = {
    title: "Inception",
    director: "Christopher Nolan",
    year: 2010,
    studio: "Warner Bros.",
    poster:
      "https://cdn.27.ua/sc--media--prod/default/ca/20/43/ca2043a4-8c0e-4855-b57a-15e796f5cfcd.jpg",
  };

  return (
    <div className="movie">
      <h1>Улюблений фільм</h1>
      <MovieDetails movie={favoriteMovie} />
    </div>
  );
}

export default App;
